func TestEval(t *testing.T) {
	str := "a:1+2-3;b:=a+1;"
	l := newlexer(str)
	p := newparser(l)
	program := p.parseprogram()
	if len(p.Errors()) != 0 {
		for err := range p.errors {
			fmt.Println(err)
		}
	}
	env := newenv()
	evaluated := eval(program, env)
	fmt.Println(evaluated.inspect())
	for k, v := range env.store {
		fmt.Println("k:", k, ", v:", v.inspect())
	}
}

