func TestEval6(t *testing.T) {
	// 注入一些测试数据
	env := newenv()

	//  设置数据
	datas := [][]any{}
	if err := json.Unmarshal([]byte(teststr), &datas); err != nil {
		panic(err)
	}

	time := arrayobj{elements: make([]obj, len(datas))}  // 0
	open := arrayobj{elements: make([]obj, len(datas))}  // 1
	high := arrayobj{elements: make([]obj, len(datas))}  // 2
	low := arrayobj{elements: make([]obj, len(datas))}   // 3
	close := arrayobj{elements: make([]obj, len(datas))} // 4
	vol := arrayobj{elements: make([]obj, len(datas))}   // 5
	amt := arrayobj{elements: make([]obj, len(datas))}   // 7
	for k, data := range datas {
		_time, _ := data[0].(float64)
		time.elements[k] = &floatobj{value: _time}
		_open, _ := strconv.ParseFloat(data[1].(string), 64)
		open.elements[k] = &floatobj{value: _open}
		_high, _ := strconv.ParseFloat(data[2].(string), 64)
		high.elements[k] = &floatobj{value: _high}
		_low, _ := strconv.ParseFloat(data[3].(string), 64)
		low.elements[k] = &floatobj{value: _low}
		_close, _ := strconv.ParseFloat(data[4].(string), 64)
		close.elements[k] = &floatobj{value: _close}
		_vol, _ := strconv.ParseFloat(data[5].(string), 64)
		vol.elements[k] = &floatobj{value: _vol}
		_amt, _ := strconv.ParseFloat(data[7].(string), 64)
		amt.elements[k] = &floatobj{value: _amt}

		fmt.Println(k, "time:", _time, "open:", _open, "high:", _high, "low:", _low, "close:", _close, "vol:", _vol, "amt:", _amt)
	}

	env.set("TIME", &time)
	env.set("OPEN", &open)
	env.set("HIGH", &high)
	env.set("LOW", &low)
	env.set("CLOSE", &close)
	env.set("VOL", &vol)
	env.set("AMT", &amt)

	// 策略
	str := `
	CC := CLOSE;
	TT := BARSCOUNT(CC);
	HP := (HHV(CC,TT)-LLV(CC,TT)/CC)<0.05
	YY := SMA(VOL,30,1);
	FL := (YY-LLV(LLV(YY,1),30))/(HHV(HHV(YY,1),30)-LLV(LLV(YY,1),30))>0.95;
	`

	l := newlexer(str)
	p := newparser(l)
	program := p.parseprogram()
	if len(p.Errors()) != 0 {
		for err := range p.errors {
			fmt.Println(err)
		}
	}

	evaluated := eval(program, env)

	fmt.Println(evaluated)
	fmt.Println("结果:")

	for i, ele := range evaluated.(*arrayobj).elements {
		if ele.(*booleanobj).value {
			fmt.Println(i,
				"FL:", env.store["FL"].(*arrayobj).elements[i],
			)
		}
	}
}

